package com.learn.spring.JavaCore.Patterns;

public class SquarePattern {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Integer a = 5;
		Integer b = 5;
		for(int i=1;i<=5;i++)
		{
			for(int j=1;j<=5;j++)
			{
				System.out.print("* ");
			}
			System.out.println();
		}
	}

}
